import React, { useState } from 'react';
import axios from 'axios';
import './registration.css'; // Ensure the CSS file path is correct

const RegistrationForm = () => {
  const [formData, setFormData] = useState({
    room: '',
    sector: '',
    feePerMonth: '',
    foodChoice: '',
    stayFrom: '',
    duration: '',
    course: '',
    registrationNo: '',
    firstName: '',
    middleName: '',
    lastName: '',
    gender: '',
    contact: '',
    email: '',
    emergencyContact: '',
    guardianName: '',
    guardianRelation: '',
    guardianContact: '',
    permanentAddress: '',
    permanentCity: '',
    permanentState: '',
    permanentPincode: ''
  });

  const [submittedData, setSubmittedData] = useState([]);
  
  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('/api/register', formData);
      alert('Registration successful!');
      
      // Add the submitted form data to the table
      setSubmittedData([...submittedData, formData]);

      // Reset the form
      setFormData({
        room: '',
        sector: '',
        feePerMonth: '',
        foodChoice: '',
        stayFrom: '',
        duration: '',
        course: '',
        registrationNo: '',
        firstName: '',
        middleName: '',
        lastName: '',
        gender: '',
        contact: '',
        email: '',
        emergencyContact: '',
        guardianName: '',
        guardianRelation: '',
        guardianContact: '',
        permanentAddress: '',
        permanentCity: '',
        permanentState: '',
        permanentPincode: ''
      });
    } catch (error) {
      console.error('Error registering:', error);
      alert('Registration failed. Please try again.');
    }
  };

  return (
    <div className="modal">
      <div className="modal-content">
        <h1 className="form-title">Hostel Registration Form</h1>
        <form className="registration-form" onSubmit={handleSubmit}>
          {/* Your form code goes here */}
        </form>

        {/* Display Table */}
        <h2>Submitted Registrations</h2>
        <table className="custom-table">
          <thead>
            <tr>
              <th>S.No</th>
              <th>Room</th>
              <th>Sector</th>
              <th>Fee Per Month</th>
              <th>Stay From</th>
              <th>Duration</th>
              <th>Course</th>
              <th>First Name</th>
              <th>Gender</th>
              <th>Contact</th>
              <th>Email</th>
            </tr>
          </thead>
          <tbody>
            {submittedData.map((item, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{item.room}</td>
                <td>{item.sector}</td>
                <td>{item.feePerMonth}</td>
                <td>{item.stayFrom}</td>
                <td>{item.duration}</td>
                <td>{item.course}</td>
                <td>{item.firstName}</td>
                <td>{item.gender}</td>
                <td>{item.contact}</td>
                <td>{item.email}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default RegistrationForm;
